import React, { useState, useEffect } from "react";
import authService from "../../services/authService";
import CursosYAsignaturas from "./CursosYAsignaturas";
import Calificaciones from "./Calificaciones";
import Asistencia from "./Asistencia";
import Recursos from "./Recursos";
import Foros from "./Foros";
import Tareas from "./Tareas";
import ReportesDeProgreso from "./ReportesDeProgreso";
import Promedios from "./Promedios";
import './estudianteCss/estudiante.css';

const EstudianteDashboard = () => {
    const [user, setUser] = useState(null);
    const [selectedSection, setSelectedSection] = useState("cursos");

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const userData = await authService.getUserData();
                setUser(userData);
            } catch (error) {
                console.error("Error al obtener datos del usuario:", error);
            }
        };
        fetchUserData();
    }, []);

    return (
        <div className="dashboard-container">
            <div className="header">
                <h1>LMS Renca</h1>
                <div>
                    {user && (
                        <div>
                            <span>{user.nombre} {user.apellido}</span>
                            <button onClick={() => authService.logout()}>Cerrar Sesi√≥n</button>
                        </div>
                    )}
                </div>
            </div>
            <div>
                <nav className="nav-bar">
                    <ul>
                        <li><button onClick={() => setSelectedSection("cursos")}>Cursos y Asignaturas</button></li>
                        <li><button onClick={() => setSelectedSection("calificaciones")}>Calificaciones</button></li>
                        <li><button onClick={() => setSelectedSection("asistencia")}>Asistencia</button></li>
                        <li><button onClick={() => setSelectedSection("recursos")}>Recursos</button></li>
                        <li><button onClick={() => setSelectedSection("foros")}>Foros</button></li>
                        <li><button onClick={() => setSelectedSection("tareas")}>Tareas</button></li>
                        <li><button onClick={() => setSelectedSection("reportes")}>Reportes de Progreso</button></li>
                        <li><button onClick={() => setSelectedSection("promedios")}>Promedios</button></li>
                    </ul>
                </nav>
                <div className="content">
                    {selectedSection === "cursos" && <CursosYAsignaturas />}
                    {selectedSection === "calificaciones" && <Calificaciones />}
                    {selectedSection === "asistencia" && <Asistencia />}
                    {selectedSection === "recursos" && <Recursos />}
                    {selectedSection === "foros" && <Foros />}
                    {selectedSection === "tareas" && <Tareas />}
                    {selectedSection === "reportes" && <ReportesDeProgreso />}
                    {selectedSection === "promedios" && <Promedios />}
                </div>
            </div>
        </div>
    );
};

export default EstudianteDashboard;
